    <>
    <Helmet>
      <title>Brett Sevy</title>
      </Helmet>
      <ThemeProvider theme={theme}>
      <PhotoHeader/>
      <UploadForm/>
      {/* <HeroSection /> */}
      {/* <Cards /> */}
           {/* <ImageGrid setSelectedImg={setSelectedImg} />
      {selectedImg && <Modal selectedImg={selectedImg} setSelectedImg={setSelectedImg} />} */}
      <ImageList/>
      <Footer />
      </ThemeProvider>
    </>
  );
}

export default PhotographyPage
